description:
This is the very first set where Lia appears as a guest model (has 4 sets currently). She is currently scheduled to have 1 guest set released on Fiona's site each month. Personally i think these folks should just give her a site of her own. She certainly deserves it! &amp; I'm sure it would be a hit!

To make things confusing, even though this is the 35th set released on Fiona's site it's numbered &amp; labeled as set 49. To make it more confusing there actually is a Set 49 on Fiona's site that features her (Fiona)... One day I'll crack their numbering code... Just not today.

